import React from 'react';
import {BrowserRouter, Route,Switch,Link,NavLink, Redirect} from 'react-router-dom';

const ExpenseDashboardPage=()=>(
    <div>
        This is from my dashboard component
    </div>
)

const AddExpensePage=()=>(
    <div>
        This is my add expense component
    </div>
)

const EditExpensePage=()=>(
    <div>
        This is my Edit expense component
    </div>
)

const HelpExpensePage=()=>(
    <div>
        This is my Help expense component
    </div>
)

const NotFoundPage=()=>(
    <div>
        404! - <Link to='/'>Go Home</Link>
    </div>
)

function headerClick() {
    console.log('headerClick')
    // alert("redirect")
    window.location.href = "/"
    return <NavLink exact to='/' activeClassName="is-active">Dashboard</NavLink>
}
    
   
    

const Header=()=>(
    <header>
        <h1 onClick={headerClick}>Expensify</h1>
        <NavLink exact to='/' activeClassName="is-active">Dashboard</NavLink>
        <NavLink to='/create' activeClassName="is-active">Create Expense</NavLink>
        <NavLink to='/edit' activeClassName="is-active">Edit Expense</NavLink>
        <NavLink to='/help' activeClassName="is-active">Help Page</NavLink>
    </header>

)

const AppRouter=()=>(
    <BrowserRouter>
    <div>
    <Header />
    <Switch>
    <Route exact path='/' component={ExpenseDashboardPage}></Route>
    <Route  path='/create' component={AddExpensePage}></Route>
    <Route  path='/edit' component={EditExpensePage}></Route>
    <Route  path='/help' component={HelpExpensePage}></Route>
    <Route component={NotFoundPage}></Route>
    </Switch>
    </div>
   
    
    </BrowserRouter>
)

export default AppRouter;
